import React, {useEffect} from 'react'
import { StyleSheet, Text, View, SafeAreaView, Button } from 'react-native';

export const History = ({route, navigation}) => { 
    const {data} = route.params; 
    let history = [];

    useEffect(()=> { 
        history.push(data)
        console.log(history)
    }, data)

    return ( 
        <Text>
            {history}
        </Text>
    )
}
